import React from 'react';
import './App.css';
import GenericCalculator from './components/GenericCalculator';
import { pricingData } from './data/pricingData';

function App() {
  // In a real app, you could allow the user to upload or select a pricing data file
  // For now, we use the default pricingData import
  return (
    <GenericCalculator pricingData={pricingData} />
  );
}

export default App;
